import React, {useState} from "react";

const MarsCamera = ()=>{
    
    const [result, setResult]= useState('')

    const rovers = [
        {
            name:"curiosity",
            cameras:['fhaz','rhaz','mast','chemcam','mahli','mardi','navcam']
        },
        {
            name:"opportunity",
            cameras:['fhaz','rhaz','navcam','pancam','minites']
        },
        {
            name:"spirit",
            cameras:['fhaz','rhaz','navcam','pancam','minites']
        },
    ];
    


    return(
        <div>{result}</div>
    )
}

export default MarsCamera;
